    "2013-03-15T21:12:24.200296",nt"name": "geospatial-data-used-in-water-level-and-land-subsidence-studies-in-the-mojave-river-and-mo-2006",nt"isopen":
    false,nt"url": null,nt"notes": "During 2006, the U.S. Geological Survey
    and other agencies made approximately 2,500 water-level measurements in the Mojave
    River and Morongo ground-water basins. These data document recent conditions and,
    when compared with previous data, changes in ground-water levels. A water-level
    contour map was drawn using data from about 680 wells, providing coverage for most
    of the basins. Twenty-five hydrographs show long-term (up to 70 years) water-level
    conditions throughout the basins, and 9 short-term (1997 to 2006) hydrographs show
    the effects of recharge and discharge along the Mojave River. In addition, a water-level-change
    map was compiled to compare 2004 and 2006 water levels throughout the basins.",nt"license_title":
